// Import necessary modules
import React from 'react';
import { useParams } from 'react-router-dom';

// RentPage component
const RentPage = () => {
  // Get the current sub-tab from the URL
  const { subTab } = useParams();

  return (
    <div>
      {/* Subheader for Rent tab */}
      <Subheader subTab={subTab} />

      {/* Content based on the selected sub-tab */}
      {subTab === 'off-campus' && <OffCampusHousing />}
      {subTab === 'for-all' && <ForAll />}
    </div>
  );
};

// Subheader component
const Subheader = ({ subTab }) => {
  return (
    <div>
      {/* Display the appropriate subheader based on the selected sub-tab */}
      {subTab === 'off-campus' && <h2>Off-Campus Housing</h2>}
      {subTab === 'for-all' && <h2>For-All</h2>}
    </div>
  );
};

// OffCampusHousing component
const OffCampusHousing = () => {
  return (
    <div>
      {/* Content for Off-Campus Housing */}
      <p>This is the Off-Campus Housing sub-tab content.</p>
    </div>
  );
};

// ForAll component
const ForAll = () => {
  return (
    <div>
      {/* Content for For-All */}
      <p>This is the For-All sub-tab content.</p>
    </div>
  );
};

// Export the RentPage component
export default RentPage;
